import React, { useEffect, useState } from 'react'
import axios from 'axios';

const Index = () => {





    const url = "https://c80c-182-79-4-248.ngrok-free.app/";
    const [proj, setData] = useState([]);

    const fetchInfo = () => {
        return axios.get(url).then((res) => setData(res.data));
    };

    useEffect(() => {
        fetchInfo();
    }, []);


    let i = 0;
    return (

        <div className="container">

            {

                proj.map(curElem => {
                    i += 1;
                    return (

                        <div className="flip-card-container" >
                            <div className="flip-card">

                                <div className="card-front">
                                    <figure>
                                        <div className="img-bg"></div>
                                        <img src={"https://source.unsplash.com/random/900*700/?night&" + i} alt="Image 2" />
                                        <figcaption>{curElem.title}</figcaption>
                                    </figure>

                                    <ul>
                                        <li><div className="heading">Project Technologies</div><div className='ans'>{curElem.tech}</div></li>
                                        <li><div className="heading">Technical_Skillset.Frontend</div> <div className='ans'>{curElem.frontend}</div></li>
                                        <li><div className="heading">Technical_Skillset.Backend</div> <div className='ans'>{curElem.backend}</div></li>
                                        <li><div className="heading">Technical_Skillset.Database</div> <div className='ans'>{curElem.db}</div></li>
                                        <li><div className="heading">Technical_Skillset.Infrastructure</div> <div className='ans'>{curElem.infra}</div></li>
                                    </ul>
                                </div>

                                <div className="card-back">
                                    <figure>
                                        <div className="img-bg"></div>
                                        <img src={"https://source.unsplash.com/random/900*700/?night&" + i} alt="Brohm Lake" />
                                    </figure>

                                    <button>Book</button>

                                    <div className="design-container">
                                        <span className="design design--1"></span>
                                        <span className="design design--2"></span>
                                        <span className="design design--3"></span>
                                        <span className="design design--4"></span>
                                        <span className="design design--5"></span>
                                        <span className="design design--6"></span>
                                        <span className="design design--7"></span>
                                        <span className="design design--8"></span>
                                    </div>
                                </div>

                            </div>
                        </div>
                    )
                })
            }

        </div>



    )
}
export default Index;
